start:
	mov ax, @data
	mov ds, ax

    mov ax, 13h
	int 10h

    ; mov ah,0h ; interrupts to get system time
    ; int 1ah

    ; mov ax,dx
    ; xor dx,dx
    ; mov cx,255
    ; div cx ;  dx contains the remain of the division - from 0 to 9
    ; inc dx

    
    mov bx, offset bush
    mov dx, 135
    mov cx, 135
    call printbush1


PROC printbush1
    pusha
    
    ; cx = x, dx = y
    mov bx, offset bush

bush1loop:
    mov al, [bx]
    add bx, 1

    cmp al, '$'
    je endd

    cmp al, 't'
    je got_ttt

    cmp al, "n"
    je got_nnn

        ; need cx = x, dx = y, al = color
    mov ah, 0ch
    int 10h

    jmp bush1loop

got_ttt:
    add cx, 1
    jmp bush1loop
        
got_nnn:
    add dx, 1
    mov cx, 135
    jmp bush1loop

endd:
        popa
        ret
endp printbush1


    

